import React from 'react';
import styled from "styled-components";
import MyMenuMyGoods from './MyMenuMyGoods';

export const MyMenuContainer = styled.div`
    bottom: 100;
    padding: 2px;
    margin-top : 40px;
    border: 1px solid red;
`;




const MyMenu = () => {
  return (
    <MyMenuContainer>
      <MyMenuMyGoods />
    </MyMenuContainer>
  );
};

export default MyMenu;
